import styled from "styled-components";

export const StyledTexture = styled.div`

  display: flex;
  padding : 5px;
  margin: 5px;
  position: absolute;
  left : 50%;
 
  div {
    display: flex;
    flex-direction: column
  }

  div > div {
    display: flex;
    flex-direction: column
  }
`;
